import React, { useState, useEffect } from "react";
import { recommendationApi, intradayApi } from "../api/endpoints";
import { useTradingStore } from "../store";
import toast from "react-hot-toast";

export default function Signals() {
  const [signals, setSignals] = useState([]);
  const [isLoading, setIsLoading] = useState(false);
  const [activeTab, setActiveTab] = useState("all");
  const [selectedMode] = useTradingStore((s) => [s.selectedMode]);

  useEffect(() => {
    fetchSignals();
  }, [activeTab]);

  const fetchSignals = async () => {
    setIsLoading(true);
    try {
      const response =
        activeTab === "intraday"
          ? await intradayApi.getIntradaySignals()
          : await recommendationApi.getActiveSignals();

      setSignals(response.data);
    } catch (error) {
      toast.error("Failed to fetch signals");
      console.error(error);
    } finally {
      setIsLoading(false);
    }
  };

  const getSignalColor = (signal) => {
    switch (signal) {
      case "BUY":
        return "text-green-600 bg-green-50";
      case "SELL":
        return "text-red-600 bg-red-50";
      case "HOLD":
        return "text-yellow-600 bg-yellow-50";
      default:
        return "text-gray-600 bg-gray-50";
    }
  };

  return (
    <div className="space-y-6">
      <div className="flex gap-2">
        <button
          onClick={() => setActiveTab("all")}
          className={`px-4 py-2 rounded-lg font-medium transition ${
            activeTab === "all"
              ? "bg-primary text-white"
              : "bg-white text-gray-700 border border-gray-300 hover:bg-gray-50"
          }`}
        >
          All Signals
        </button>
        <button
          onClick={() => setActiveTab("intraday")}
          className={`px-4 py-2 rounded-lg font-medium transition ${
            activeTab === "intraday"
              ? "bg-primary text-white"
              : "bg-white text-gray-700 border border-gray-300 hover:bg-gray-50"
          }`}
        >
          ⚡ Intraday
        </button>
      </div>

      {isLoading ? (
        <div className="text-center py-12">
          <div className="inline-block animate-spin text-4xl">⏳</div>
          <p className="text-gray-600 mt-4">Loading signals...</p>
        </div>
      ) : signals.length === 0 ? (
        <div className="bg-white rounded-lg shadow-md p-12 text-center">
          <p className="text-gray-600 text-lg">No signals available</p>
          <p className="text-gray-400">Generate a recommendation to see signals</p>
        </div>
      ) : (
        <div className="grid grid-cols-1 lg:grid-cols-2 gap-6">
          {signals.map((signal) => (
            <div
              key={signal.id}
              className={`rounded-lg shadow-md p-6 border-l-4 ${getSignalColor(
                signal.signal
              )}`}
            >
              <div className="flex justify-between items-start mb-4">
                <div>
                  <h3 className="text-xl font-bold">{signal.stock_symbol}</h3>
                  <p className="text-sm text-gray-600">{signal.created_at}</p>
                </div>
                <span className="text-2xl font-bold">{signal.signal}</span>
              </div>

              {selectedMode === "pro" && (
                <div className="grid grid-cols-2 gap-4 mt-4 pt-4 border-t border-gray-200">
                  <div>
                    <p className="text-sm text-gray-600">Entry</p>
                    <p className="text-lg font-semibold">₹{signal.entry_price}</p>
                  </div>
                  <div>
                    <p className="text-sm text-gray-600">Stop Loss</p>
                    <p className="text-lg font-semibold">₹{signal.stop_loss}</p>
                  </div>
                  <div>
                    <p className="text-sm text-gray-600">Target 1</p>
                    <p className="text-lg font-semibold">₹{signal.target_1}</p>
                  </div>
                  <div>
                    <p className="text-sm text-gray-600">Confidence</p>
                    <p className="text-lg font-semibold">{signal.confidence}%</p>
                  </div>
                </div>
              )}

              <button className="mt-4 w-full bg-primary text-white py-2 rounded-lg hover:shadow-lg transition font-medium">
                Execute Trade
              </button>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}
